let WORD_LENGTH = 5;
let options_to_print = 5;

// Build an array of the letters of the alphabet.
export
const alphabet : string[] = new Array(26);

for (let i = 0; i < alphabet.length; i++){
    alphabet[i] = String.fromCharCode(i+97);
}

let letter_score : {[letter: string] : number} = {};

let hard_mode : boolean = false;

export
function setHardMode(hm : boolean){
    hard_mode = hm;
}


export
function wordScore(word : string, dic : string[]) : number {
    
    let score : number = 0;
    if (hard_mode){
        score = -freq_score[word];
    }else{
        for (let i = 0; i < word.length; i++){
            score += letter_score[word[i]];
        }
    }
    return score;
}

function scoreLetters(dic : string[]){
        
    alphabet.forEach(function(l){
        letter_score[l] = 0;
    });   

    for (let index in dic){
        // console.log(index);
        let cur_word : string = dic[index];
        for (let char_index = 0; char_index < cur_word.length; char_index++){
            // console.log(cur_word[char_index]);
            let cur_char = cur_word[char_index];
            letter_score[cur_char]++;
        }
    }
}


export
function wordSuggestions(word : string, colors : string, dic : string[]) : string[] {

    let guess_letter_count : {[letter : string] : number} = {};    
    alphabet.forEach(function(l){
        guess_letter_count[l] = 0;
    }); 

    let good_letters = Array(WORD_LENGTH);
    let filtered_dict : string[];

    for (let i = 0; i < WORD_LENGTH; i++){
        good_letters[i] = new Set(alphabet);
    }

    // This has to be populated first to list all possible words
    // when a gray duplicate letter appears before a yellow letter.
    let cur_yellow_letters = new Set<string>();
    for (let i = 0; i < colors.length; i++){
        if (colors[i] == 'Y'){
            cur_yellow_letters.add(word[i]);
        }
    }
   
    for (let i = 0; i < colors.length; i++){
        let color : string = colors[i];
        if (color == 'G'){
            good_letters[i] = new Set([word[i]]);
            guess_letter_count[word[i]]++;
        }else if (color == 'Y'){
            guess_letter_count[word[i]]++;
            good_letters[i].delete(word[i]);
        }else{
            good_letters[i].delete(word[i]);
            if (!cur_yellow_letters.has(word[i])){
                for (let j = 0; j < good_letters.length; j++){
                    if (good_letters[j].has(word[i]) && good_letters[j].size != 1){
                        good_letters[j].delete(word[i]);
                    }
                }
            }
        }
    }
    // console.log(good_letters);

    filtered_dict = dic.filter(function(elem){
        let valid : boolean = true;     
        let cur_letter_count  : {[letter : string] : number} = {};
        alphabet.forEach(function(l){
            cur_letter_count[l] = 0;
        }); 
        for (let i = 0; valid && i < elem.length; i++){
            valid = valid && good_letters[i].has(elem[i]);
            cur_letter_count[elem[i]]++;
        }
        // Make sure we're always using all known letters.
        for (let letter in cur_letter_count){
            if(cur_letter_count[letter] < guess_letter_count[letter]){
                return false;
            }
        }
        for (const yellow_letter of cur_yellow_letters){
            if (valid){
                valid = valid && elem.includes(yellow_letter);
            }else{
                return false;
            }
        }

        return valid;
    });
    
    scoreLetters(filtered_dict);

    filtered_dict.sort(function(a,b) : number {

        let a_score = wordScore(a, dic);
        let b_score = wordScore(b, dic);
        if (a_score < b_score){
            return -1;
        }else if(b_score < a_score) {
            return 1;
        }
        return 0;
    });
    
    // return [];

    return filtered_dict; 
}